import React from 'react';
import { Box, Grid } from '@material-ui/core';

const Services = () => {
    return (
        <>
            <section>
                <Box className="container-fluid my-5">
                    <Grid container>
                        <Grid item lg={10} md={11} xs={12}></Grid>
                    </Grid>
                </Box>
            </section>
        </>
    )
}

export default Services
